public Enumeration<String> getParameterNames() {
  final Iterator<String> i = m.keySet().iterator();
  return new Enumeration<String>() {
    @Override
    public boolean hasMoreElements() {
      return i.hasNext();
    }
    @Override
    public String nextElement() {
      return i.next();
    }
  };
}
